        public int InsertUnitPaymentLog()
        {
            try
            {
                SqlParameter[] arrParam = new SqlParameter[17];
                arrParam[0] = new SqlParameter("@InvoiceNo", InvoiceNo);
                arrParam[1] = new SqlParameter("@User_ID", User_ID);
                arrParam[2] = new SqlParameter("@User_Type", User_Type);
                arrParam[3] = new SqlParameter("@InvoiceTo", InvoiceTo);
                arrParam[4] = new SqlParameter("@Unit_ID", Unit_ID);
                arrParam[5] = new SqlParameter("@Unit_Number", Unit_Number);
                arrParam[6] = new SqlParameter("@Plot_Number", Plot_Number);
                arrParam[7] = new SqlParameter("@Floor_Number", Floor_Number);
                arrParam[8] = new SqlParameter("@Area_Name", Area_Name);
                arrParam[9] = new SqlParameter("@UnitPermitType", UnitPermitType);
                arrParam[10] = new SqlParameter("@LicenseNo", LicenseNo);
                arrParam[11] = new SqlParameter("@Amount", Amount);
                arrParam[12] = new SqlParameter("@TRN", TRN);
                arrParam[13] = new SqlParameter("@Reference", Reference);
                arrParam[14] = new SqlParameter("@PaymentTerms", PaymentTerms);
                arrParam[15] = new SqlParameter("@UnitPaymentTransactionType", UnitPaymentTransactionType);
                arrParam[16] = new SqlParameter("@ID", SqlDbType.Int);
                arrParam[16].Direction = ParameterDirection.InputOutput;

                mSqlConnection = new SqlConnection(RakTDAApi.BLL.Common.General.dbConStr);
                mSqlConnection.Open();
                mTransaction = mSqlConnection.BeginTransaction();
                SqlHelper.ExecuteScalar(mTransaction, CommandType.StoredProcedure, "sp_InsertUnitPaymentLog", arrParam);
                mTransaction.Commit();
                int chk = int.Parse(arrParam[16].Value.ToString());
                mSqlConnection.Close();
                return chk;
            }
            catch (Exception ex)
            {
                //Utility.ExceptionHelper.Log(ex);
                return 0;
            }
        }

        public DataSet GetUnitPaymentLogSearch()
        {
            try
            {
                DataSet dsTemp = new DataSet();
                SqlParameter[] arrParam = new SqlParameter[5];
                arrParam[0] = new SqlParameter("@Id", Id);
                arrParam[1] = new SqlParameter("@User_ID", User_ID);
                arrParam[2] = new SqlParameter("@User_Type", User_Type);
                arrParam[3] = new SqlParameter("@Unit_ID", Unit_ID);
                arrParam[4] = new SqlParameter("@UnitPaymentTransactionType", UnitPaymentTransactionType);

                dsTemp = SqlHelper.ExecuteDataset(RakTDAApi.BLL.Common.General.dbConStr, CommandType.StoredProcedure, "sp_GetUnitPaymentLogSearch", arrParam);
                return dsTemp;
            }
            catch (Exception ex)
            {
                return null;
            }
        }

